import * as THREE from '/build/three.module.js';
import {OrbitControls} from '/jsm/controls/OrbitControls.js';
import Stats from '/jsm/libs/stats.module.js';

var time = 0;
const scene = new THREE.Scene();
const w = document.getElementById('d').clientWidth; //window.innerWidth
const h = document.getElementById('d').clientHeight; //window.innerHeight
console.log(w, h)
const camera = new THREE.PerspectiveCamera(75, w / h, 0.1, 1000);
camera.position.z = 80;

const renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });
renderer.setSize(w, h);
document.getElementById('d').appendChild(renderer.domElement);

const controls = new OrbitControls(camera, renderer.domElement);

const starVert = "uniform float u_time;vec3 mod289(vec3 x) {return x - floor(x * (1.0 / 289.0)) * 289.0;}"+
                 "vec4 mod289(vec4 x) {return x - floor(x * (1.0 / 289.0)) * 289.0;}"+
                 "vec4 permute(vec4 x) {return mod289(((x*34.0)+1.0)*x);}"+
                 "vec4 taylorInvSqrt(vec4 r){return 1.79284291400159 - 0.85373472095314 * r;}"+
                 "float snoise(vec3 v){const vec2  C = vec2(1.0/6.0, 1.0/3.0) ;const vec4  D = vec4(0.0, 0.5, 1.0, 2.0); vec3 i  = floor(v + dot(v, C.yyy) );vec3 x0 =   v - i + dot(i, C.xxx) ;vec3 g = step(x0.yzx, x0.xyz);vec3 l = 1.0 - g;vec3 i1 = min( g.xyz, l.zxy );vec3 i2 = max( g.xyz, l.zxy );vec3 x1 = x0 - i1 + C.xxx;vec3 x2 = x0 - i2 + C.yyy;vec3 x3 = x0 - D.yyy;i = mod289(i);vec4 p = permute( permute( permute( i.z + vec4(0.0, i1.z, i2.z, 1.0 )) + i.y + vec4(0.0, i1.y, i2.y, 1.0 )) + i.x + vec4(0.0, i1.x, i2.x, 1.0 ));float n_ = 0.142857142857;vec3  ns = n_ * D.wyz - D.xzx;"+
                 "vec4 j = p - 49.0 * floor(p * ns.z * ns.z);vec4 x_ = floor(j * ns.z);vec4 y_ = floor(j - 7.0 * x_ );vec4 x = x_ *ns.x + ns.yyyy;vec4 y = y_ *ns.x + ns.yyyy;vec4 h = 1.0 - abs(x) - abs(y);vec4 b0 = vec4( x.xy, y.xy );vec4 b1 = vec4( x.zw, y.zw );vec4 s0 = floor(b0)*5.0 + 5.0;vec4 s1 = floor(b1)*5.0 + 5.0;vec4 sh = -step(h, vec4(0.0));vec4 a0 = b0.xzyw + s0.xzyw*sh.xxyy ;vec4 a1 = b1.xzyw + s1.xzyw*sh.zzww ;vec3 p0 = vec3(a0.xy,h.x);vec3 p1 = vec3(a0.zw,h.y);vec3 p2 = vec3(a1.xy,h.z);vec3 p3 = vec3(a1.zw,h.w);vec4 norm = taylorInvSqrt(vec4(dot(p0,p0), dot(p1,p1), dot(p2, p2), dot(p3,p3)));"+
                 "p0 *= norm.x; p1 *= norm.y; p2 *= norm.z; p3 *= norm.w; vec4 m = max(0.6 - vec4(dot(x0,x0), dot(x1,x1), dot(x2,x2), dot(x3,x3)), 0.0); m = m * m; return 42.0 * dot( m*m, vec4( dot(p0,x0), dot(p1,x1), dot(p2,x2), dot(p3,x3) ) ); }"+
                 "vec3 snoiseVec3( vec3 x ){ float s  = snoise(vec3( x )); float s1 = snoise(vec3( x.y - 19.1 , x.z + 33.4 , x.x + 47.2 )); float s2 = snoise(vec3( x.z + 74.2 , x.x - 124.5 , x.y + 99.4 )); vec3 c = vec3( s , s1 , s2 ); return c; }"+
                 "vec3 curlNoise( vec3 p ){const float e = .1;vec3 dx = vec3( e   , 0.0 , 0.0 );vec3 dy = vec3( 0.0 , e   , 0.0 );vec3 dz = vec3( 0.0 , 0.0 , e   );vec3 p_x0 = snoiseVec3( p - dx );vec3 p_x1 = snoiseVec3( p + dx );vec3 p_y0 = snoiseVec3( p - dy );vec3 p_y1 = snoiseVec3( p + dy );vec3 p_z0 = snoiseVec3( p - dz );vec3 p_z1 = snoiseVec3( p + dz );float x = p_y1.z - p_y0.z - p_z1.y + p_z0.y;float y = p_z1.x - p_z0.x - p_x1.z + p_x0.z;float z = p_x1.y - p_x0.y - p_y1.x + p_y0.x;const float divisor = 1.0 / ( 2.0 * e );return normalize( vec3( x , y , z ) * divisor );}"+
                 "varying vec3 newPosition;void main() {gl_PointSize = .5;newPosition = position * (40. + curlNoise(position+u_time/5.)* 10.);gl_Position = projectionMatrix * modelViewMatrix * vec4(newPosition, 1.0);}";
const  starFrag = "varying vec3 newPosition;void main() {gl_FragColor = vec4(0.3,0,0,.3);}";

let starsGeometry = new THREE.BufferGeometry();
let position = [];
for (var i = 0; i < 100000; i++) {

    // var star = new THREE.Vector3();
    let alpha = Math.random() * (Math.PI * 2);
    let theta = Math.random() * Math.PI;

    let x = Math.cos(alpha) * Math.sin(theta);
    let y = Math.sin(alpha) * Math.sin(theta);
    let z = Math.cos(theta);

    position.push(x, y, z);

}

starsGeometry.setAttribute( 'position', new THREE.Float32BufferAttribute( position, 3 ) );
var uniforms = {
    u_time: { type: "f", value: 1.5 },
    diffuse: { type: "c", value: { r:1, g:0, b:0 } }
};


const starsMaterial = new THREE.ShaderMaterial({
    uniforms: uniforms,
    vertexShader: starVert,
    fragmentShader: starFrag 
});

var starField = new THREE.Points(starsGeometry, starsMaterial);
scene.add(starField);


const planGeo = new THREE.BoxGeometry(32, 32, 1);
//this.planMat = new THREE.MeshBasicMaterial({ color: 0xff0000, flatShading: true });
const texture = new THREE.TextureLoader().load('data:image/png;base64,');
const planMat = new THREE.MeshBasicMaterial({ map: texture, flatShading: true });
planMat.transparent = true
const planet = new THREE.Mesh(planGeo, planMat);
scene.add(planet);


// 
// 
// 

window.addEventListener('resize', () => {
    camera.aspect = document.getElementById('d').clientWidth / document.getElementById('d').clientHeight;
    camera.updateProjectionMatrix();
    renderer.setSize(w, h);
    render();
}, false);

const stats = Stats();
document.body.appendChild(stats.dom);

var animate = function () {
    requestAnimationFrame(animate);
    time += 0.01;
    planet.rotation.y += 0.001;
    starsMaterial.uniforms.u_time.value = time;
    controls.update();
    render();
    stats.update();
};

function render() {
    renderer.render(scene, camera);
}

animate();